import React, {Component} from 'react';
import {connect} from 'react-redux';

class ProfileCard extends Component {
   render() {
      return (
         <div>
            Profile Card
         </div>
      );
   }
}

function mapStateToProps(state) {
   return {};
}

export default connect(
   mapStateToProps,
)(ProfileCard);
